PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "customer_customer_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customer_id" bigint NOT NULL REFERENCES "customer_customer" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "customer_customer_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customer_id" bigint NOT NULL REFERENCES "customer_customer" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "address_address" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "phone" varchar(17) NOT NULL, "email" varchar(254) NOT NULL, "user_address_id" bigint NULL REFERENCES "customer_customer" ("id") DEFERRABLE INITIALLY DEFERRED, "area" varchar(20) NOT NULL, "block" varchar(5) NOT NULL, "building_name" varchar(20) NOT NULL, "flat_number" varchar(10) NOT NULL, "floor" varchar(20) NULL, "street" varchar(20) NOT NULL, "name" varchar(30) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "customer_customer" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "products_products_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "products_id" bigint NOT NULL REFERENCES "products_products" ("id") DEFERRABLE INITIALLY DEFERRED, "category_id" bigint NOT NULL REFERENCES "category_category" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "cart_cart" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "number_of_items" integer unsigned NOT NULL CHECK ("number_of_items" >= 0), "total" decimal NOT NULL, "text_percentage" decimal NOT NULL, "text_total" decimal NOT NULL, "user_id" bigint NOT NULL REFERENCES "customer_customer" ("id") DEFERRABLE INITIALLY DEFERRED, "activate_date" datetime NULL, "deactivate_date" datetime NULL, "status" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "cart_cartitem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "cart_item_id" bigint NULL REFERENCES "cart_cart" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NULL REFERENCES "products_products" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "category_category" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "slug" varchar(50) NOT NULL, "description" text NOT NULL, "activate_date" datetime NULL, "deactivate_date" datetime NULL, "status" integer NOT NULL, "categories" varchar(100) NOT NULL, "user_id" bigint NULL REFERENCES "customer_customer" ("id") DEFERRABLE INITIALLY DEFERRED, "parent_id" bigint NULL REFERENCES "category_category" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "customer_customer" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "birth_date" date NULL, "gender" varchar(8) NOT NULL, "address" text NOT NULL, "phone_number" varchar(17) NOT NULL, "age" integer NULL, "manager_id" bigint NULL REFERENCES "customer_customer" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "customer_business" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "company_name" varchar(20) NOT NULL, "phone_number" varchar(17) NOT NULL, "company_email" varchar(254) NOT NULL, "Year_of_Establishment" date NOT NULL, "product_category" varchar(10) NOT NULL, "revenue" decimal NOT NULL, "offline_channel" bool NOT NULL, "company_profile" text NOT NULL, "portfolio" integer NOT NULL, "business_customer_id" bigint NULL REFERENCES "customer_customer" ("id") DEFERRABLE INITIALLY DEFERRED, "Nature_of_business" varchar(15) NOT NULL, "number_of_employees" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "order_points" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "points_gained" integer NOT NULL, "order_point_id" bigint NULL UNIQUE REFERENCES "order_order" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "customer_customer" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "order_order" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "price" decimal NOT NULL, "date_added" datetime NOT NULL, "address_id" bigint NULL REFERENCES "address_address" ("id") DEFERRABLE INITIALLY DEFERRED, "status" integer NOT NULL, "user_id" bigint NOT NULL REFERENCES "customer_customer" ("id") DEFERRABLE INITIALLY DEFERRED, "activate_date" datetime NULL, "deactivate_date" datetime NULL, "cart_id" bigint NULL REFERENCES "cart_cart" ("id") DEFERRABLE INITIALLY DEFERRED, "product_id" bigint NULL REFERENCES "products_products" ("id") DEFERRABLE INITIALLY DEFERRED, "estimated_delivery_charges" integer NOT NULL, "tax" integer NOT NULL, "total_cost" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "products_products" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "price" decimal NOT NULL, "slug" varchar(50) NOT NULL, "brand" varchar(50) NOT NULL, "old_price" decimal NOT NULL, "new_price" decimal NOT NULL, "is_bestseller" bool NOT NULL, "is_featured" bool NOT NULL, "quantity" integer unsigned NOT NULL CHECK ("quantity" >= 0), "meta_keywords" varchar(50) NOT NULL, "meta_description" varchar(50) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "activate_date" datetime NULL, "deactivate_date" datetime NULL, "status" integer NOT NULL, "business_user_id" bigint NULL REFERENCES "customer_business" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NULL REFERENCES "customer_customer" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "tag_taggeditem" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "tag" varchar(50) NOT NULL, "object_id" integer unsigned NOT NULL CHECK ("object_id" >= 0), "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED);
